			shellScript = "#  Adapted by script created by Kamil Kocemba on 09/01/2013.\n\nTARGET=BRCocoaLumberjack\nACTION=\"clean build\"\nLIB=libBRCocoaLumberjack.a\nPRODUCT=BRCocoaLumberjack\n\nOUTPUT_DIR=\"${PROJECT_DIR}/Framework\"\nFRAMEWORK_DIR=\"${OUTPUT_DIR}/${PRODUCT}.framework\"\nHEADERS_DIR=\"${OUTPUT_DIR}/Headers\"\n\n# Start clean by removing output dir\nrm -rf ${HEADERS_DIR}\nmkdir -p \"${HEADERS_DIR}\"\n\n# Copy source headers into flat Headers directory\ncp \"${PROJECT_DIR}/\"*.h \"${PROJECT_DIR}/BRCocoaLumberjack/\"*.h \"${PROJECT_DIR}/../CocoaLumberjack/Lumberjack/\"*.h \"${HEADERS_DIR}\"\n\n# change to \"Release Debug\" to build both\nCONFIGURATIONS=\"Release\"\nfor CONFIG in ${CONFIGURATIONS}; do\nFRAMEWORK_DIR=\"${OUTPUT_DIR}/${CONFIG}/${PRODUCT}.framework\"\n\necho \"${OUTPUT_DIR}\"\necho \"${FRAMEWORK_DIR}\"\nrm -rf \"${FRAMEWORK_DIR}\"\n\nDEVICE_DIR=${SYMROOT}/${CONFIG}-iphoneos\nSIMULATOR_DIR=${SYMROOT}/${CONFIG}-iphonesimulator\nUNIVERSAL_DIR=${SYMROOT}/${CONFIG}-universal\n\nxcodebuild -configuration ${CONFIG} -target ${TARGET} -sdk iphoneos ${ACTION} RUN_CLANG_STATIC_ANALYZER=NO CONFIGURATION_BUILD_DIR=${DEVICE_DIR}\nxcodebuild -configuration ${CONFIG} -target ${TARGET} -sdk iphonesimulator ${ACTION} RUN_CLANG_STATIC_ANALYZER=NO CONFIGURATION_BUILD_DIR=${SIMULATOR_DIR}\n\nrm -rf \"${UNIVERSAL_DIR}\"\nmkdir \"${UNIVERSAL_DIR}\"\n\nlipo -create -output \"${UNIVERSAL_DIR}/${PRODUCT}\" \"${DEVICE_DIR}/${LIB}\" \"${SIMULATOR_DIR}/${LIB}\"\n\nmkdir -p \"${FRAMEWORK_DIR}/Versions/A\"\n\ncd \"${FRAMEWORK_DIR}/Versions\"\nln -sf A Current\n\ncp -r \"${HEADERS_DIR}\" \"${FRAMEWORK_DIR}/Versions/Current/\"\ncp \"${UNIVERSAL_DIR}/${PRODUCT}\" \"${FRAMEWORK_DIR}/Versions/Current\"\n\ncd \"${FRAMEWORK_DIR}\"\nln -sf \"Versions/Current/${PRODUCT}\" \"${PRODUCT}\"\nln -sf Versions/Current/Headers Headers\ndone\n";
